import React from 'react';
import Seearchbar from './Seearchbar';
import { Link } from 'react-router-dom';
import ProfilePhoto from './Profilephoto';

const Navbar = () => {
  return (
    <div className='bg-gray-400 flex flex-row px-14 shadow-xl items-center justify-between h-20'>
      <div>
        <h1 className='text-3xl text-blue-700  font-bold'> EthioBet</h1>
      </div>

      <div>
        <Seearchbar />
      </div>

      <div className='flex   justify-between space-x-4'>
        
        <Link to="/" >
          <p className='font-bold text-lg'>Home</p>
        </Link>
        <Link to="/about">
          <p className='font-bold text-lg'>About</p>
        </Link>
        <ProfilePhoto />
        <Link to="/profile" >
          <img src="/images/genz.jpg" alt='profile' 
          className='w-8 h-8 rounded-full'/> 
        </Link>
      </div>
    </div>
  );
}

export default Navbar;
